USE ismapper;

CREATE TABLE project
(
  id varchar(255) NOT NULL,
  email varchar(255) NOT NULL,
  title text NOT NULL,
  date bigint(99) NOT NULL,
  ready bigint(1) NOT NULL,
  PRIMARY KEY (id)
);


CREATE TABLE data_demo
(
  id bigint(99) NOT NULL,
  name varchar(255) NOT NULL,
  chr varchar(2) NOT NULL,
  start bigint(99) NOT NULL,
  end bigint(99) NOT NULL,
  mapq bigint(11) NOT NULL,
  cigar varchar(255) NOT NULL,
  seq text NOT NULL,
  PRIMARY KEY (id)
);


CREATE TABLE cancerGenes
(
  id int(99) NOT NULL,
  gene varchar(255) NOT NULL,
  name text NOT NULL,
  chr varchar(255) NOT NULL,
  start int(99) NOT NULL,
  end int(99) NOT NULL,
  band varchar(255) NOT NULL,
  entrez varchar(255) NOT NULL,
  molgenetics varchar(255) NOT NULL,
  synonyms text NOT NULL,
  tt_somatic text NOT NULL,
  tt_germline text NOT NULL,
  PRIMARY KEY (id)
);


CREATE TABLE cancerTumours
(
  id int(99) NOT NULL,
  abbreviation text NOT NULL,
  term text NOT NULL,
  mutation text NOT NULL,
  genes text NOT NULL,
  PRIMARY KEY (id)
);


